function ComponenteCompetencia(props) {
  return (
    <div style={styles.container}>
      <div style={styles.content}>
        <div style={styles.nome}>{props.nome}</div>
        <div style={styles.descricao}>{props.descricao}</div>
      </div>
    </div>
  );
}

const styles = {
  container: {
    background: "red",
    color: "white",
    width: "40%",
    margin: "auto",
    padding: "2%",
    border: "2px solid yellow",
    borderRadius: "5px",
  },
  content: {
    textAlign: "center",
  },
  nome: {
    fontSize: "1.2em",
    fontWeight: "bold",
    marginBottom: "0.5em",
  },
  descricao: {
    fontSize: "1em",
  },
};

